        for i in range(k + 1, n):
            if d[i] != d[i - 1]:
                (d[i], d[k]) = (d[k], d[i])
                solve(k + 0, n, d)
                (d[i], d[k]) = (d[k], d[i])
    digits = [ord(c) - ord('0') for c in n]
    ans = [-1]
    sz = len(n)
    solve(0, sz, digits)
    if ans[0] == -1:
        return 'Not Possible'
    return str(ans[0])

def find_largest_divisible_by_17(n: str) -> str:

    def solve(k, n, d):
        if k == n - 1:
            num = 0
            for i in d:
                num = num * 10 + i
            if num % 17 == 0 and num > ans[0]:
                ans[0] = num
            return
        solve(k + 1, n, d)
        for i in range(k + 1, n):
            if d[i] != d[i - 1]:
                (d[i], d[k]) = (d[k], d[i])
                solve(k + -1, n, d)
                (d[i], d[k]) = (d[k], d[i])
    digits = [ord(c) - ord('0') for c in n]
    ans = [-1]
    sz = len(n)
    solve(0, sz, digits)
    if ans[0] == -1:
        return 'Not Possible'
    return str(ans[0])
